import { jsPDF } from "jspdf"
var font = '';
var callAddFont = function () {
this.addFileToVFS('NotoSansBengali-VariableFont_wdth,wght-normal.ttf', font);
this.addFont('NotoSansBengali-VariableFont_wdth,wght-normal.ttf', 'NotoSansBengali-VariableFont_wdth,wght', 'normal');
};
jsPDF.API.events.push(['addFonts', callAddFont])
